import React from 'react'
import styled from 'styled-components'
function SignUp() {
    const SigninBlock = styled.div`
        width:512px;
        height:760px;
        position:relative;
        background:white;
        border-radius:16px;
        bix-shadow:0 0 8px rgba(0,0,0,0.04);
        margin:0 auto;
        margin-top:96px;
        margin-bottom:32px;
        display:flex;
        flex-direction:column;
        .Header {
            padding:48px 32px 24px 32px;
            border-bottom:1px solid #e9ecef;

            .H1 {
                margin:0;
                font-size:36px;
                color:#343940;
            }
            .text {
                font-size: 18px;
                color:#206997;
                margin-top:40px;
                font-weight:bold;

            }
        }
    `
    return (
        <SigninBlock>
            <div className="Header">
                <h1 className="h1">Sign Up</h1>
                <span className="text">회원가입</span>
            </div>
        </SigninBlock>
    )
}
export default SignUp
